    false,nt"url": null,nt"notes": "This report summarizes our contaminants
    investigation at the abandoned Cold Bay Air Force Station (Station), located on
    the Izembek National Wildlife Refuge at Grant Point. Our investigation was conducted
    in 1988 by Wayne M. Crayton (Ecological Services Anchorage) and members of your
    staff. The report centers on determining what, if any, contaminants from the facility
    may have entered the surrounding refuge environment and is provided to assist you
    in managing contaminant-related issues on your refuge. Included is a summary of
    field activities, an interpretation of selected analytical data and recommendations
    to remediate any identified contaminant problems.",nt"license_title": "License
